DROP FUNCTION IF EXISTS GetEstoqueAlmoxarifado$$
CREATE DEFINER=root@localhost FUNCTION GetEstoqueAlmoxarifado(pre_codigo INT(5), usa_codigo INT(10), alm_codigo INT(10)) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
    DECLARE total NUMERIC(10,2);

    IF (usa_codigo > 0) THEN
    	SELECT SUM(a.aeu_estoque) INTO total FROM almoxarifadosestoqueunidades a
	WHERE a.aeu_pre_codigo = pre_codigo
	AND   a.aeu_alm_codigo = alm_codigo
	AND   a.aeu_usa_codigo = usa_codigo;
    ELSE
    	SELECT SUM(a.aeu_estoque) INTO total FROM almoxarifadosestoqueunidades a
	WHERE a.aeu_pre_codigo = pre_codigo
	AND   a.aeu_alm_codigo = alm_codigo;
    END IF;
    RETURN IFNULL(total, 0);
END$$

DROP FUNCTION IF EXISTS GetEstoqueAlmoxarifadoLote$$
CREATE DEFINER=root@localhost FUNCTION GetEstoqueAlmoxarifadoLote(pre_codigo INT(5), usa_codigo INT(10), alm_codigo INT(10), lote VARCHAR(20)) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
    DECLARE entradas, saidas NUMERIC(10,2);

    SET entradas = GetTotalEntradaAlmoxarifadosLote(pre_codigo, usa_codigo, alm_codigo, lote);
    SET saidas   = GetTotalSaidaAlmoxarifadosLote(pre_codigo, usa_codigo, alm_codigo, lote);

    RETURN (IFNULL(entradas, 0) - IFNULL(saidas, 0));
END$$

DROP FUNCTION IF EXISTS VerificaChaveTabela$$
CREATE DEFINER=root@localhost FUNCTION VerificaChaveTabela(tabela VARCHAR(100), chave INT(10), prefeitura INT(10), usuariologado INT(10)) RETURNS int(10)
BEGIN
    DECLARE resultado INT(10);
	DECLARE duplicado INT(5) DEFAULT 0;
	DECLARE contador INT(5) DEFAULT 1;
    DECLARE DONE bool DEFAULT FALSE;

	SET resultado = chave;

    REPEAT
    BEGIN
          DECLARE CONTINUE HANDLER FOR 1062
          BEGIN
			SET duplicado = 1;
		 	SET contador = contador + 1;
		  	SET resultado = resultado + 1;
            SET DONE = FALSE;
          END;

          SET DONE = TRUE;

		  IF DONE THEN
			SET contador = 4;
          END IF;
    END;
    UNTIL contador >= 4 END REPEAT;

    IF NOT DONE THEN
		SET resultado = 0;
	END IF;
	RETURN resultado;
END$$

DELIMITER ;

